          <h3>{contact.firstName} {contact.lastName}</h3>
          <p><strong>Username:</strong> {contact.username}</p>
          <p><strong>Email:</strong> {contact.email}</p>
          <p><strong>Message:</strong> {contact.message}</p>
          <hr />
        </li>
      ))}
    </ul>
  </div>
  );
};

export default Output;
